import React from 'react'

//style
import "../styles/components/main/main.css"

//dependencies


//main-content section component
const HtmlCss = () => {
    return <div>
        Hello html css
    </div>
}

const Js = () => {
  return <div>Hello html css</div>;
};

const Reactjs = () => {
  return <div>Hello html css</div>;
};

export default function Main() {
    return (
        <main className="main-content">
            <div className="content-container">
                <header>
                    <nav>
                        <div className="container">
                            <ul>
                                <li className="active">
                                    HTML & CSS
                                </li>
                                <li>
                                    JAVASCRIPT
                                </li>
                                <li>
                                    REACT
                                </li>
                            </ul>
                        </div>
                    </nav>
                </header>
                <div className="content-showcase">
                    <div className="html-css-showcase" id="html-css-showcase">
                        <HtmlCss/>
                    </div>
                    <div className="javascript-showcase" id="javascript-showcase">
                        <Js/>
                    </div>
                    <div className="react-showcase" id="react-showcase">
                        <Reactjs/>
                    </div>
                </div>
            </div>
        </main>
    )
}
